import React from 'react';
import Navbarin from '../components/Navbarin.js';
import { Card } from 'react-bootstrap';
import { ListGroup } from 'react-bootstrap';
export default class Profile extends React.Component {

    ProfilePage() {
        return (
            <React.Fragment>
                <Navbarin handleLogout={this.handleLogout}/>
                <div style={{ width: '30%', marginTop: '50px', marginLeft: '5%'}}><h1>Account Overview</h1></div>
                <Card style={{ shadowColor: "#000",
                    shadowOffset: {
                        width: 0,
                        height: 2,
                    },
                    shadowOpacity: 0.25,
                    shadowRadius: 3.84,

                    elevation: 5, width: '30%', float: 'left', marginLeft: '5%', marginTop: '20px' }}>
                    <Card.Body>
                        <Card.Title>Runwei Lin</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted">Fan Since 2019</Card.Subtitle>
                        <ListGroup variant="flush">
                            <ListGroup.Item>My Tickets</ListGroup.Item>
                            <ListGroup.Item>My Listings</ListGroup.Item>
                            <ListGroup.Item>Favorites</ListGroup.Item>
                            <ListGroup.Item>Settings</ListGroup.Item>
                            <ListGroup.Item>Payment Options</ListGroup.Item>
                        </ListGroup>
                    </Card.Body>
                </Card>
                <Card style={{ shadowColor: "#000",
                    shadowOffset: {
                        width: 0,
                        height: 2,
                    },
                    shadowOpacity: 0.25,
                    shadowRadius: 3.84,

                    elevation: 5, width: '55%', float: 'right', marginLeft: '5%', marginRight: '5%', marginTop: '20px'}}>
                    <Card.Body>
                        <Card.Title>Your Points and Reward Points</Card.Title>
                    </Card.Body>
                </Card>
            </React.Fragment>
        );
    }

    render() {
        return this.ProfilePage();
    }
}
